[[package]]
name = "black"
version = "21.9b0"
description = "The uncompromising code formatter."
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
click = ">=7.1.2"
mypy-extensions = ">=0.4.3"
pathspec = ">=0.9.0,<1"
platformdirs = ">=2"
regex = ">=2020.1.8"
tomli = ">=0.2.6,<2.0.0"
typing-extensions = [
    {version = ">=3.10.0.0", markers = "python_version < \"3.10\""},
    {version = "!=3.10.0.1", markers = "python_version >= \"3.10\""},
]

[package.extras]
colorama = ["colorama (>=0.4.3)"]
d = ["aiohttp (>=3.6.0)", "aiohttp-cors (>=0.4.0)"]
jupyter = ["ipython (>=7.8.0)", "tokenize-rt (>=3.2.0)"]
python2 = ["typed-ast (>=1.4.2)"]
uvloop = ["uvloop (>=0.15.2)"]

[[package]]
name = "boto"
version = "2.49.0"
description = "Amazon Web Services Library"
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "boto3"
version = "1.18.63"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.21.63,<1.22.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.5.0,<0.6.0"

[package.extras]
crt = ["botocore[crt] (>=1.21.0,<2.0a0)"]

[[package]]
name = "boto3-stubs"
version = "1.18.63"
description = "Type annotations for boto3 1.18.63, generated by mypy-boto3-builder 5.5.0"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
botocore-stubs = "*"
mypy-boto3-ec2 = {version = ">=1.18.58", optional = true, markers = "extra == \"ec2\""}
mypy-boto3-efs = {version = ">=1.18.58", optional = true, markers = "extra == \"efs\""}
mypy-boto3-rds = {version = ">=1.18.58", optional = true, markers = "extra == \"rds\""}
mypy-boto3-sqs = {version = ">=1.18.58", optional = true, markers = "extra == \"sqs\""}

